import { SET_CURRENT_USER, CLEAR_CURRENT_USER } from "../../commons/types";

export const setCurrentUser = (user: any) => {
  return {
    type: SET_CURRENT_USER,
    payload: user,
  };
};

export const clearCurrentUser = () => {
  return {
    type: CLEAR_CURRENT_USER,
  };
};
